import {combineReducers} from 'redux';

const persistConfig = {
    key: 'root',
    storage,
    whitelist: [
      // 'user',
      'allCourses',
      'cafeDetails',
      'courseTopicsAndCompletionDetails',
      'feeDetails',
      'feeAmount',
      'student',
      // 'test',
      // 'assignment',
      'lecture',
      'courseOverview',
      'verifiedStudent',
      'assignCourses',
      'feeUpdate',
      'testEvaluationList',
      'evaluateTests',
      'unverifiedStudent',
    ],
  };

  
const rootReducer = combineReducers({

});

export default persistReducer(persistConfig, rootReducer);
